import React from 'react';



function Home (){
    return (
        <div>
           <h1>Home</h1>
            <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success">Search</Button>
          </Form>
        </div>
    )
}
export default Home;
